import React from 'react';
// import '../../App.css';
import './order.css';


import { useEffect, useState } from "react";

function Request() {
  const [label, setLabel] = useState("");
  const [vm, setVm] = useState("");
  const [vn, setVn] = useState("");
  const [ad, setAd] = useState("");

  useEffect(() => {
    const urlParams = new URLSearchParams(window.location.search);
    setLabel(urlParams.get("label"));
    setVm(urlParams.get("vm"));
    setVn(urlParams.get("vn"));
    setAd(urlParams.get("ad"));
  }, []);

  return (
    <div className="order-confirmation-container">
      <h2>Order Details</h2>
      <div className="order-details">
        <div className="order-item">
          <span>Service Type: </span>
          <span style={{ color: "brown" }}>{label}</span>
        </div>
        </div>
            <div className="order-item">
              <span>Location:</span>
              {/* <span>{this.props.match.params.order_id}</span> */}
              <span style={{
          color: 'brown',
        }}>{label}</span>
        <div className="order-item">
          <span>Vehicle Type:</span>
          <span style={{ color: "brown" }}>Four Wheeler</span>
        </div>
        <div className="order-item">
          <span>Vehicle Make:</span>
          <span style={{ color: "brown" }}>{vm}</span>
        </div>
        <div className="order-item">
          <span>Vehicle Number:</span>
          <span style={{ color: "brown" }}>{vn}</span>
        </div>
        <div className="order-item">
          <span>Additional Details:</span>
          <span style={{ color: "brown" }}>{ad}</span>
        </div>
      </div>
      <p className="confirmation-message">
        Thank you for your order! Our team will be in touch with you shortly.
      </p>
    </div>
  );
}


export default Request 


  

